	(62, 'Fazer rotinas financeiras e de compras para a Aline', '', '0000-00-00', 'uploads/', 36, 123, '2023-06-26 17:51:46', 'sandyraiane408@gmail.com', NULL),
	(63, 'fazer formulário para solicitar compras, com dias de prazo. ', '', '0000-00-00', 'uploads/', 36, 109, '2023-06-26 18:10:54', 'sandyraiane408@gmail.com', NULL),
	(64, 'Novo COmentario', 'victorafaeloliveira@gmail.com,vinicius.soc@gmail.com', '0000-00-00', 'uploads/', 18, 194, '2023-06-27 15:16:32', 'victorafaeloliveira@gmail.com', NULL),
	(65, 'Foi realizada reunião com os responsáveis em visita à sede e filial da empresa para levantamento de informações sobre o entendimento macro do funcionamento da empresa, como setores, atividades principais, rotinas, dentre outros. Além disso, foi feito o cronograma da empresa de acordo com sua estrutura atual para estudo e melhorias futuras.', '', '0000-00-00', 'uploads/', 27, 72, '2023-06-28 12:28:16', 'andressamarques7@icloud.com', NULL),
	(66, 'Não existe um organograma definido, hierarquicamente a empresa está confusa. A finalização do entendimento está previsto para 28/06. Um organograma geral irá ser elaborado não será necessário uma detalhamento tão profundo dos cargos, funções e reposnsabilidades pois uma consultoria especifica foi contratada. ', '', '0000-00-00', 'uploads/', 27, 73, '2023-06-28 12:58:25', 'sandyraiane408@gmail.com', NULL),
	(67, 'A principio os setores de atendimento e instalação serão os trabalhados. ', '', '0000-00-00', 'uploads/', 27, 75, '2023-06-28 13:12:36', 'sandyraiane408@gmail.com', NULL),
	(68, 'Desenhar organograma, plano de cargos e salários \r\nEstoque – vários sistemas pontos críticos (sem controle de nada, gerando custos) \r\nOutra consultoria de liderança vai fazer a parte de RH, mas ele quer que a gente faça. \r\nInvestimento em marketing, eles tem programa de indicação\r\nProcesso de instalação – processo crítico (eles fazem o acompanhamento pelo whatsapp, Experiência do cliente, atendimento (rotina, pesquisa de satisfação, busca ativa, alocar funções e atividades, berçário (monitoramento por pelo menos 4 meses) do cliente)\r\nPontos fracos: Falta de processos, cargos definidos, falta de cultura organizacional, planejamento em alguns setores. \r\n', '', '0000-00-00', 'uploads/', 27, 72, '2023-06-28 13:14:12', 'sandyraiane408@gmail.com', NULL),
	(69, 'A cliente repassou uma planilha de controle de estoque que apresentava erros de fórmulas para ser analisada. Após entrar em contato a mesma, foi identificado que a empresa gostaria de um controle de estoque por Excel em para isso, foi elaborada uma planilha de controle de estoque.', '', '0000-00-00', 'uploads/', 36, 165, '2023-06-28 15:01:30', 'andressamarques7@icloud.com', NULL),
	(70, 'Informativos de cobrança (formas de pagamento e politicas de crédito)', 'sandyraiane408@gmail.com,andressamarques7@icloud.com,vinicius.soc@gmail.com', '0000-00-00', 'uploads/', 36, 181, '2023-06-29 14:28:43', 'sandyraiane408@gmail.com', NULL),
	(71, 'Repasses para a Aline (rotinas, mensagens automáticas de cobrança): AlôChat (comunicação interna, acesso de relatórios somente para gerêncial) Como arquivar documentos Informações do contrato: Informativo do cliente, mudança de data de vencimento, taxas, ', '', '0000-00-00', 'uploads/', 36, 181, '2023-06-29 14:53:13', 'sandyraiane408@gmail.com', NULL),
	(72, 'Sobre as políticas de preço: \r\n- Precificar diferente os "níveis" da peça (deixar avisado para o cliente sobre a possibilidade de alteração de preço)\r\n- Trabalhar a "conscientização" como estratégia para reduzir os custos da operação. \r\n- Tabela de cobrança extra para nivéis de sujidade. \r\n- ', '', '0000-00-00', 'uploads/', 36, 123, '2023-06-29 18:29:12', 'sandyraiane408@gmail.com', NULL),
	(73, 'Politica: 2% para juros e 3% para mora, a partir da data do vencimento sem carência', '', '0000-00-00', 'uploads/', 36, 123, '2023-06-29 18:58:00', 'sandyraiane408@gmail.com', NULL),
	(74, 'Informativo: em julho, implantação do Alôchat e alterações no contrato, cobrança de multa, cobrança de mofo. S\r\nVip: vai pagar mensal e quinzenal via boleto\r\nOutro cliente: só paga à vista \r\nTerá taxa de recolhimento e entrega? (abaixo de valor x cobrar) raio de 3 km', '', '0000-00-00', 'uploads/', 36, 181, '2023-06-29 19:25:27', 'sandyraiane408@gmail.com', NULL),
	(75, '', '', '0000-00-00', 'uploads/', 36, 181, '2023-06-29 19:53:57', 'sandyraiane408@gmail.com', NULL),
	(76, 'Possibilidade de desconto por já possuir o saco, lugares de entrega e coletas, recolher assinatura no recebimento, adicionar taxa de entrega caso não tenha ninguém para receber', '', '0000-00-00', 'uploads/', 36, 181, '2023-06-29 19:54:19', 'sandyraiane408@gmail.com', NULL),
	(77, 'Planilha de controle de estoque de forma incompleta, por isso não possui dados concretos para a análise. \r\nA Mara utiliza planilha para medir o tempo de coleta e entrega dos motoristas. ', '', '0000-00-00', 'uploads/', 36, 97, '2023-06-30 13:49:59', 'sandyraiane408@gmail.com', NULL),
	(78, '|Planilha de controle de estoque atualizada ', '', '0000-00-00', 'uploads/', 36, 98, '2023-06-30 13:50:44', 'sandyraiane408@gmail.com', NULL),
	(79, 'Politica comercial elaborada. \r\nComunicado aos clientes sobre alterações depreço e outras', '', '0000-00-00', 'uploads/', 36, 99, '2023-06-30 13:52:30', 'sandyraiane408@gmail.com', NULL),
	(80, 'Atividade realizada antes da visita da consultoria, apenas faltando a atualização no sistema SWL ', '', '0000-00-00', 'uploads/', 36, 100, '2023-06-30 13:56:08', 'sandyraiane408@gmail.com', NULL),
	(81, 'Controle em caderno', '', '0000-00-00', 'uploads/', 36, 97, '2023-06-30 16:40:31', 'sandyraiane408@gmail.com', NULL),
	(82, 'Processo realizado pelo Jonas: \r\nOs clientes ativos já tem dia certo para a coleta, novos clientes são atendidos via SAC, encaminhados para o administrativo para realizar cadastro e é avisado que possivelmente o dia da coleta será na terça feira (pois é o dia dos menores clientes), caso haja necessidade é feito uma realocação de dia de coleta depois. ', '', '0000-00-00', 'uploads/', 36, 104, '2023-06-30 16:43:41', 'sandyraiane408@gmail.com', NULL),
	(83, 'A Aline tem a chave do estoque, as solicitações são feitas via whatsapp, entrega os sacos (com 100 unidades). ', '', '0000-00-00', 'uploads/', 36, 109, '2023-06-30 16:46:30', 'sandyraiane408@gmail.com', NULL),
	(84, 'Os impostos possuem valores em abertos e com prévia de entrada em sistema CADIN, após isso pode perder a possibilidade de simples nacional e decorrer impostos mais severos para a formatação de preço da empresa.', 'vinicius.soc@gmail.com', '0000-00-00', 'uploads/', 36, 134, '2023-06-30 16:53:17', 'vinicius.soc@gmail.com', NULL),
	(85, 'é feito um contato prévio com o cliente para perguntar se terá itens para a coleta, caso a resposta seja positiva já entra na rota, caso não responda o próximo cliente entrará na lista ', '', '0000-00-00', 'uploads/', 36, 104, '2023-06-30 16:53:53', 'sandyraiane408@gmail.com', NULL),
	(86, 'Pontos Críticos:\r\n- Política comercial falha e com muitas brechas para cobrança;\r\n- Ausência de controles produtivos e indicadores de falhas produtivas;\r\n- Processos não foram revisados e não estão sendo postos em prática;\r\n- Carga de empréstimos está comprometendo o fluxo de caixa da empresa e não permitindo desafogo operacional;', '', '0000-00-00', 'uploads/', 36, 124, '2023-06-30 16:56:36', 'vinicius.soc@gmail.com', NULL),
	(87, 'Política de comissão ainda não foi finalizado mas foi apresentado algumas ideias e precisa de maior finalização da proposta.', '', '0000-00-00', 'uploads/', 36, 133, '2023-06-30 16:58:29', 'vinicius.soc@gmail.com', NULL),
	(88, 'No atendimento on-line precisa de distinguir quem realizará cobrança e quem realizará o envio de notas e boleto. Sugestão: tem que ser realizado o envio de faturamento e pagamento pelo SAC e de cobrança de vencidos o setor financeiro.', '', '0000-00-00', 'uploads/', 36, 113, '2023-06-30 17:27:39', 'vinicius.soc@gmail.com', NULL),
	(89, 'Teste de comentario', 'victorafaeloliveira@gmail.com', '0000-00-00', 'uploads/', 18, 221, '2023-07-02 15:26:16', 'victorafaeloliveira@gmail.com', NULL),
	(90, 'Outro COmentario', 'admin@admin.com', '0000-00-00', 'uploads/', 18, 221, '2023-07-02 17:04:48', 'victorafaeloliveira@gmail.com', NULL),
	(91, 'sdfsdf', NULL, NULL, NULL, NULL, 90, '2023-07-02 17:17:24', NULL, NULL),
	(92, 'teste de resposta', NULL, NULL, NULL, NULL, 90, '2023-07-02 17:19:22', NULL, NULL),
	(93, 'O plano de contas foi revisado com a diretoria e foi realizado um treinamento de lançamento de contas conforme a nova configuração com a colaboradora responsável pelo financeiro. A atualização do plano de contas foi realizada juntamente com essa colaboradora e foram feitos alguns testes de lançamentos.', '', '0000-00-00', 'uploads/', 36, 100, '2023-07-07 12:13:28', 'andressamarques7@icloud.com', NULL),
	(94, 'A diretora da empresa informou que não seria possível repassar o certificado digital da empresa de forma que a análise tributária da empresa e a verificação da possibilidade de dedução de impostos pelas cestas básicas não poderá ser realizada.', '', '0000-00-00', 'uploads/', 36, 134, '2023-07-07 12:18:25', 'andressamarques7@icloud.com', NULL),
	(95, 'Uma nova planilha de controle de estoque foi construída de acordo com as necessidades da cliente, ela foi repassada com os colaboradores que utilizarão a planilha. Por fim, será realizado o acompanhamento da utilização da planilha de controle de estoque.', '', '0000-00-00', 'uploads/', 36, 165, '2023-07-07 12:26:51', 'andressamarques7@icloud.com', NULL),
	(96, 'Foi elaborado um documento com as principais rotinas relacionadas ao setor financeiro da empresa, com links para vídeos contendo conteúdos extras. Esse documento tem como objetivo instruir os colaboradores do setor financeiro sobre rotinas e atividades para maior eficácia no trabalho.', '', '0000-00-00', 'uploads/', 36, 135, '2023-07-07 12:34:43', 'andressamarques7@icloud.com', NULL),
	(97, 'A empresa optou por permanecer oferecendo como forma de pagamento PIX, transferência bancária e dinheiro. Dessa forma, foi realizado apenas a a estruturação dos planos de pagamentos e a elaboração da política comercial da empresa.', '', '0000-00-00', 'uploads/', 36, 132, '2023-07-07 13:04:27', 'andressamarques7@icloud.com', NULL),
	(100, 'Processos dos setores de Atendimento, Instalação e manutenção', '', '0000-00-00', 'uploads/', 27, 76, '2023-07-11 19:53:13', 'sandyraiane408@gmail.com', NULL),
	(111, 'Comentario de Subtarefa 1', 'victorafaeloliveira@gmail.com', '0000-00-00', 'uploads/', 41, 240, '2023-07-14 12:23:54', 'admin@admin.com', NULL),
	(112, 'comentario de comentario', NULL, NULL, NULL, NULL, NULL, '2023-07-14 12:26:12', 'admin@admin.com', 111),
	(113, 'Emitir notas (XPERT) - Editar nomes - Protocolar no portal do fornecedor - atualizar planilha de controle', '', '0000-00-00', 'uploads/', 44, 285, '2023-07-14 18:22:19', 'andressamarques7@icloud.com', NULL),
	(114, 'Atendimento: Entendimento geral\r\n- Assuntos financeiros\r\n- Mudança de plano\r\n- Suporte técnico (Caso não resolva pelo atendimento virtual, é feita a abertura de OS pra o técnico resolver in loco)\r\n- Corporativo - comercial específico para PJ\r\n\r\n* Assuntos financeiros: bloqueio por falta de pagamento, solicitação de segunda via de boleto ou pix, acompanhamento dos contratos por aplicativos que foram pagos, lembrança de pagamento para clientes que possuem aplicativos, pós-venda.\r\n* Relacionamento: mudança de plano, cancelamento, retenção, alteração de vencimento, \r\n* Suporte técnico: lentidão, queda, bloqueio, instabilidade, ', '', '0000-00-00', 'uploads/', 27, 78, '2023-07-18 17:19:45', 'andressamarques7@icloud.com', NULL),
	(115, '- Em casos de inadimplência +2 ou 3 meses, renegociação, o atendimento é passado para o setor financeiro.\r\n\r\n- Em caso de problemas técnicos que precisam ser resolvidos in loco, é feito a abertura de OS, agendamento do técnico para o dia seguinte, acompanhamento via sistema do trabalho do técnico, é verificado a finalização do atendimento. Serviço finalizado? o cliente volta para o atendimento e inicia o processo de pós-suporte. Nesse processo é feito o contato com o cliente até 7 dias depois para saber se persiste o problema ou foi resolvido. Caso não, é enviado o técnico novamente.\r\n\r\nMudança de plano - sempre que é feita a mudança de plano para utilização de aplicativos, alterar cadastro para 13, porque facilita o relatório', '', '0000-00-00', 'uploads/', 27, 78, '2023-07-18 17:20:09', 'andressamarques7@icloud.com', NULL),
	(116, 'Atendimento comercial: novo cliente\r\nCentrado na vitória * \r\n*pouco tempo na empresa, não faz controle de CRM.\r\n- Recebe a solicitação de novo cadastro de cliente - faz a venda - realiza o novo cadastro - abre a OS de instalação (+) - repassa atendimento para setor instalação \r\n\r\nOBS* deveria fazer a parte de pós-venda, mas não é feito. Setor de atendimento passou a fazer.\r\nOBS 2: últimos clientes com contratos feitos por ela estão com planos básicos (falta de venda mais ativa)\r\n\r\nATENÇÃO NO COMERCIAL (Vitória)', '', '0000-00-00', 'uploads/', 27, 78, '2023-07-18 17:20:36', 'andressamarques7@icloud.com', NULL),
	(117, 'MIT 05/07:\r\nManutenção: Entendimento geral\r\nGeovane tem a equipe com 3 técnicos.\r\nEle realiza o alinhamento das demandas a serem realizadas em campo antes.\r\n\r\nSmarth sistema\r\nTodo dia: total autorizado (quantidade de clientes que estão ativos - alerta de rompimento) e as OLTs verifica a temperatura e se estão ativas. A OLTs indicam a temperatura do pop, quando está alta desliga o equipamento ou queimar o pop e afeta a conexão de internet.\r\n\r\nGrafana sistema: acompanha a atividade dos app ou plataformas dos planos.\r\n\r\nTelegram: grupo com os equipamentos. Eles repassam uma mensagem da situação da maquina para o telegram. O acompanhamento é feito em tempo real.\r\n\r\n\r\nGeovane:\r\n- Esse controle é o start do processo. Ele primeiro faz a verificação de como estão as conexões, rede, ativações do cliente.\r\n- Quando há algum algum “erro”, qual o problema, onde é o problema, como resolver.\r\n- Abre a OS (+). Escolhe o técnico que vai realizar o atendimento, repassa o serviço com o técnico e envia ele. \r\n- Técnico: no grupo do WhatsApp: ele envia localização, foto da casa e a OS em PDF (porque eles precisam de contexto: nome do cliente e o que será feito). E da início ao atendimento no sistema.\r\n- Acompanhamento: é feito pelo sistema, pelo grupo e caso haja algum problema o técnico entra em contato com o Geovane. Também existem o acompanhamento físico/pessoal , quando ele vai até o técnico e acompanha a atividade pra saber se o técnico está realizando certinho. \r\nEstoque de material: quando o técnico realiza o atendimento e utiliza material , ele coloca na OS o que foi utilizado e aquele material da baixa no estoque dele.\r\n\r\nOBS: Geovane não abre OS pra os atendimento de manutenção dele. O controle dos custos é feito numa planilha, para repassar à diretoria os custos dos atendimentos de manutenção realizados por ele, porque não se adaptou ao sistema. Mas demonstrou que realmente deveria deixar registros.\r\n\r\nTodo mês ele apresenta um relatório de atividades do mês.', '', '0000-00-00', 'uploads/', 27, 78, '2023-07-18 17:21:25', 'andressamarques7@icloud.com', NULL),
	(118, 'Suporte: Entendimento geral \r\nInício: recebe demanda no atendimento- atendente abre a os- a Patrícia coloca o atendimento na agenda do técnico para o dia seguinte - eles veem a agenda do dia - se preparam para os atendimentos - Patrícia verifica o material do técnico de acordo com o atendimento - confirma com o técnico o estoque que ele tem - o técnico tem que usar o cartão pra ligar o carro (nairo que acompanha essa utilização do carro) - \r\n Chega - manda foto, localização e os em pdf - se identifica no Cliente - realiza o serviço - resolvem o problema - finaliza a OS e o cliente assina. Volta pra empresa ou vai pra o proximo cliente.\r\nCaso não finalizar/resolver o atendimento, preencher na OS o que ocorreu. Abre a OS para Manutenção ou agenda outra visita \r\n\r\nChegando na empresa: Guardar o material no armários, caso não haja nenhum outro atendimento no dia. Marca o ponto no celular e fim.', '', '0000-00-00', 'uploads/', 27, 78, '2023-07-18 17:21:48', 'andressamarques7@icloud.com', NULL);
